/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `generate_ma_ve` BEFORE INSERT ON `ve` FOR EACH ROW BEGIN
    DECLARE new_ma_ve VARCHAR(10);
    SET new_ma_ve = CONCAT(
        SUBSTRING(MD5(RAND()), 1, 5),
        SUBSTRING(MD5(RAND()), 1, 5)
    );
    
    -- Kiểm tra tính duy nhất của mã vé
    WHILE EXISTS (SELECT 1 FROM ve WHERE ma_ve = new_ma_ve) DO
        SET new_ma_ve = CONCAT(
            SUBSTRING(MD5(RAND()), 1, 5),
            SUBSTRING(MD5(RAND()), 1, 5)
        );
    END WHILE;

    SET NEW.ma_ve = new_ma_ve;
END */;;
